import React from "react";

import { Row, Col, Card } from 'react-materialize';

import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import HotelPraia from '../../images/home/hotel_praia.jpg';
import Restaurante from '../../images/home/restaurante.jpg';



const Compra = ({ match }) => (
	<Route path={`${match.path}/:topicId`} component={Topic} />

);

const content = {
  descricao: 'aquela boa e velha descrição',
  HotelPraia: {
    name: 'Hotel na Praia',
    imageUrl: '../../images/home/hotel_praia.jpg',
  },
  Restaurante: {
    name: 'Hotel na Praia',
    imageUrl: '../../images/home/hotel_praia.jpg',
  },
};

function conteudo(props){
	return (
    	<p>{props.desc}</p>
    );
}


function Topic() {
	return (
		<Conteudo desc={content.descricao}/>
	);
}




export default Compra;
